import NavMenu from './Components/NavMenu';
import Home from './Components/Home'
import Visit from './Components/Visit';
import { Routes ,Route } from 'react-router-dom';

function App() {
  return (
    <>
      <NavMenu />
      <Routes>
        <Route path ='/' exact></Route>
      </Routes>
      <Home />
      <Visit />
    </>
  );
}

export default App;
